import { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();
    this.state = {
      mosters: [
        {
          id:'1',
          name: "Virendra",
        },
        {
          id:'2',
          name: "Vishal",
        },
        {
          id:'3',
          name: "Aniketh",
        },
        {
          id:'4',
          name:"Muragesh"
        },
        {
          id:'5',
          name:"Shashank"
        }
      ],
    };
  }

  render() {
    return (
      <div className="App">
        {this.state.mosters.map((moster) => {
          return <div key={moster.id}><h1>Hello !! {moster.name}</h1></div>;
        })}
      </div>
    );
  }
}

export default App;
